(1, 2459, 1, NULL, NULL, NULL, 'Moya Territoriya Group', '0', 'Olimlar xamda Gulbadanbegim ko\'chalari kesishmasida', NULL, 0.00, NULL, 'Мавжуд', 'Мавжуд', 'Мавжуд', NULL, 'https://www.google.com/maps?q=41.346237494128744,69.335381313943', 41.3462375, 69.3353813, NULL, '54171.37', 4512.84, '18000 kv.m', '761 ta', 'Yoq', '4891 yer maydonida 2323 qurilish maydoni', '7-poliknilika, qabul qilish 400 ta, 45 ta xona', 'Yoq', 'Yoq', NULL, '422 ta daraxt', '6087 kv.m', NULL, 'Kommunal ta’minot markazlashtirilgan usulda amalga oshiriladi.\r\nUchastka chegaralarida magistral gaz quvurlari, vodoprovodlar, kanalizatsiya, issiq suv ta’minoti mavjud.\r\nRenovatsiya loyihasini amalga oshirishda quyidagi tarmoqlarga ulanish talab etiladi:\r\nElektr ta’minoti:\r\n• 0,4 kV quvvatga ega 1,4 km kabelni SIP tipidagi yangi kabelga almashtirish.\r\nGulbadanbegim va Olimlar ko‘chasi;\r\nGaz ta’minoti:\r\nGulbadanbegim va Olimlar ko‘chalari bo‘ylab 1600 p/m D-219mm o‘rta bosimli gaz quvuri o‘tkazish;\r\nRDBK 80 li gaz taqsimlash stansiyasining 5-qurilmasi;\r\nSuv ta’minoti:\r\nOlimlar ko‘chasi bo‘ylab 450 p/m D-250mm suv quvurlarini yotqizish.\r\nKanalizatsiya:\r\n• 500 p/m miqdorda D-600mm kanalizatsiya yotqizish.', NULL, NULL, '2025-01-03 14:35:38', '2025-01-03 14:35:38', 328),
